<?php

$img = <<<EOD
<image width="512" height="349" color="color_1" mode="mono"></image>
EOD;

$printerIp = "192.168.2.127";
$url = 'http://' . $printerIp . '/cgi-bin/epos/service.cgi?devid=epson&timeout=10000';
$request = <<<EOD
    <s:Envelope xmlns:s="http://schemas.xmlsoap.org/soap/envelope/">
    <s:Body>
    <epos-print xmlns="http://www.epson-pos.com/schemas/2011/03/epos-print">
    $img
    <text smooth="true" align="center" width="1" height="1" reverse="false">Jung, Brutal, Gutaussehend.</text>
    <feed/>
    <text smooth="true" align="center" width="1" height="1" reverse="false">DER Schlepper.</text>
    <feed/>
    <cut type="feed" />
    </epos-print>
    </s:Body>
    </s:Envelope>
    EOD;

    //Initiate cURL
    $curl = curl_init($url);
    
    //Set the Content-Type to text/xml.
    curl_setopt($curl, CURLOPT_HTTPHEADER, array("Content-Type: text/xml", "If-Modified-Since: Thu, 01 Jan 1970 00:00:00 GMT", "SOAPAction: \"\""));
    
    //Set CURLOPT_POST to true to send a POST request.
    curl_setopt($curl, CURLOPT_POST, true);
    
    //Attach the XML string to the body of our request.
    curl_setopt($curl, CURLOPT_POSTFIELDS, $request);
    
    //Tell cURL that we want the response to be returned as
    //a string instead of being dumped to the output.
    curl_setopt($curl, CURLOPT_RETURNTRANSFER, true);
    
    //Execute the POST request and send our XML.
    $result = curl_exec($curl);
    
    //Do some basic error checking.
    if(curl_errno($curl)){
        throw new Exception(curl_error($curl));
    }
    
    //Close the cURL handle.
    curl_close($curl);
    
    //Print out the response output.
    echo $result;

?>